function show_menu_for_admins_editors( $items, $args ) {
    if( is_admin() || current_user_can('edit_others_posts') ) {
        return $items;
    }

    foreach ( $items as $key => $item ) {
        if ( 103570 == $item->object_id ) {
            unset( $items[ $key ] );
        }
    }
    return $items;
}
add_filter( 'wp_nav_menu_objects', 'show_menu_for_admins_editors', 10, 2 );

